const HEADERLINKS = {
  ABOUTME: "aboutMe",
  EXPERIENCE: "Experience",
  SKILLS: "Skills",
  PROJECTS: "Projects",
  BLOGS: "Blogs"
}
const Header = () => {
  return (
    <div className="header-wrapper">
      <ul className="header__links">
        {
          HEADERLINKS.values().map((value) => (
            <li>{value}</li>
          ))
        }
      </ul>
    </div>
  )
}


export default Header
